import TodoList from '../components/index'

export default class Main extends Component {
    render() {
        return (
            <div>
                <TodoList />
                <p> Copyright @ Ezeh Victor</p>
                 <p className='small'>email:vim64@yahoo.com</p>
            </div>
        )
    }
}
